@import "tailwindcss";

@theme {
  --color-bg-dark: #191C27;
  --color-card-dark: #393D52;
  --color-bg-light: #ECF0F8;
  --color-card-light: #FFFFFF;

  --color-chart-1: #6E6EF7; /* Example generic chart colors */
  --color-chart-2: #E88C33;
  --color-chart-3: #2EB086;
  --color-chart-4: #D94452;
}

:root {
  font-family: Inter, system-ui, Avenir, Helvetica, Arial, sans-serif;
  line-height: 1.5;
  font-weight: 400;
}

body {
  margin: 0;
  min-height: 100vh;
}

import { twMerge } from 'tailwind-merge';

interface CardProps extends React.HTMLAttributes<HTMLDivElement> {
  children: React.ReactNode;
  theme?: 'dark' | 'light';
}

export function Card({ children, className, theme = 'dark', ...props }: CardProps) {
  return (
    <div
      className={twMerge(
        'rounded-3xl p-6 shadow-xl flex flex-col',
        theme === 'dark' ? 'bg-card-dark text-white' : 'bg-card-light text-slate-900',
        className
      )}
      {...props}
    >
      {children}
    </div>
  );
}

import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { Card } from '../ui/Card';

const data = [
  { name: 'Mon', value: 4000 },
  { name: 'Tue', value: 3000 },
  { name: 'Wed', value: 2000 },
  { name: 'Thu', value: 2780 },
  { name: 'Fri', value: 1890 },
  { name: 'Sat', value: 2390 },
  { name: 'Sun', value: 3490 },
];

interface BarChartBlockProps {
  theme?: 'dark' | 'light';
}

export function BarChartBlock({ theme = 'dark' }: BarChartBlockProps) {
  const barColor = theme === 'dark' ? '#6E6EF7' : '#5A5AB5';
  const gridColor = theme === 'dark' ? '#444' : '#eee';
  const textColor = theme === 'dark' ? '#ccc' : '#666';

  return (
    <Card theme={theme} className="h-80 w-full">
      <h3 className="text-lg font-semibold mb-4">Weekly Revenue</h3>
      <div className="flex-1 w-full min-h-0">
        <ResponsiveContainer width="100%" height="100%">
          <BarChart data={data}>
            <CartesianGrid strokeDasharray="3 3" vertical={false} stroke={gridColor} />
            <XAxis 
              dataKey="name" 
              stroke={textColor} 
              axisLine={false}
              tickLine={false}
              tick={{ fill: textColor }}
            />
            <YAxis 
              stroke={textColor} 
              axisLine={false}
              tickLine={false}
              tick={{ fill: textColor }}
            />
            <Tooltip 
              cursor={{ fill: theme === 'dark' ? '#ffffff10' : '#00000010' }}
              contentStyle={{ 
                backgroundColor: theme === 'dark' ? '#2d2d3d' : '#fff',
                borderColor: 'transparent',
                borderRadius: '8px',
                color: theme === 'dark' ? '#fff' : '#000'
              }}
            />
            <Bar dataKey="value" fill={barColor} radius={[4, 4, 0, 0]} />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </Card>
  );
}

import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { Card } from '../ui/Card';

const data = [
  { name: 'Jan', uv: 4000, pv: 2400, amt: 2400 },
  { name: 'Feb', uv: 3000, pv: 1398, amt: 2210 },
  { name: 'Mar', uv: 2000, pv: 9800, amt: 2290 },
  { name: 'Apr', uv: 2780, pv: 3908, amt: 2000 },
  { name: 'May', uv: 1890, pv: 4800, amt: 2181 },
  { name: 'Jun', uv: 2390, pv: 3800, amt: 2500 },
  { name: 'Jul', uv: 3490, pv: 4300, amt: 2100 },
];

interface LineChartBlockProps {
  theme?: 'dark' | 'light';
}

export function LineChartBlock({ theme = 'dark' }: LineChartBlockProps) {
  const strokeColor1 = '#8884d8';
  const strokeColor2 = '#82ca9d';
  const gridColor = theme === 'dark' ? '#444' : '#eee';
  const textColor = theme === 'dark' ? '#ccc' : '#666';

  return (
    <Card theme={theme} className="h-80 w-full">
      <h3 className="text-lg font-semibold mb-4">Traffic Trends</h3>
      <div className="flex-1 w-full min-h-0">
        <ResponsiveContainer width="100%" height="100%">
          <LineChart data={data}>
            <CartesianGrid strokeDasharray="3 3" vertical={false} stroke={gridColor} />
            <XAxis 
              dataKey="name" 
              stroke={textColor} 
              axisLine={false}
              tickLine={false}
              tick={{ fill: textColor }}
            />
            <YAxis 
              stroke={textColor} 
              axisLine={false}
              tickLine={false}
              tick={{ fill: textColor }}
            />
            <Tooltip 
              contentStyle={{ 
                backgroundColor: theme === 'dark' ? '#2d2d3d' : '#fff',
                borderColor: 'transparent',
                borderRadius: '8px',
                color: theme === 'dark' ? '#fff' : '#000'
              }}
            />
            <Line type="monotone" dataKey="pv" stroke={strokeColor1} strokeWidth={3} dot={false} activeDot={{ r: 8 }} />
            <Line type="monotone" dataKey="uv" stroke={strokeColor2} strokeWidth={3} dot={false} />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </Card>
  );
}

import { PieChart, Pie, Cell, ResponsiveContainer, Tooltip, Legend } from 'recharts';
import { Card } from '../ui/Card';

const data = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 },
  { name: 'Group D', value: 200 },
];

const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

interface PieChartBlockProps {
  theme?: 'dark' | 'light';
}

export function PieChartBlock({ theme = 'dark' }: PieChartBlockProps) {
  return (
    <Card theme={theme} className="h-80 w-full">
      <h3 className="text-lg font-semibold mb-4">Distribution</h3>
      <div className="flex-1 w-full min-h-0">
        <ResponsiveContainer width="100%" height="100%">
          <PieChart>
            <Pie
              data={data}
              innerRadius={60}
              outerRadius={80}
              fill="#8884d8"
              paddingAngle={5}
              dataKey="value"
            >
              {data.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
              ))}
            </Pie>
            <Tooltip 
               contentStyle={{ 
                backgroundColor: theme === 'dark' ? '#2d2d3d' : '#fff',
                borderColor: 'transparent',
                borderRadius: '8px',
                color: theme === 'dark' ? '#fff' : '#000'
              }}
            />
            <Legend />
          </PieChart>
        </ResponsiveContainer>
      </div>
    </Card>
  );
}

import { Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, ResponsiveContainer, Tooltip } from 'recharts';
import { Card } from '../ui/Card';

const data = [
  { subject: 'Math', A: 120, B: 110, fullMark: 150 },
  { subject: 'Chinese', A: 98, B: 130, fullMark: 150 },
  { subject: 'English', A: 86, B: 130, fullMark: 150 },
  { subject: 'Geography', A: 99, B: 100, fullMark: 150 },
  { subject: 'Physics', A: 85, B: 90, fullMark: 150 },
  { subject: 'History', A: 65, B: 85, fullMark: 150 },
];

interface RadarChartBlockProps {
  theme?: 'dark' | 'light';
}

export function RadarChartBlock({ theme = 'dark' }: RadarChartBlockProps) {
  const gridColor = theme === 'dark' ? '#666' : '#ccc';
  const textColor = theme === 'dark' ? '#ccc' : '#666';

  return (
    <Card theme={theme} className="h-80 w-full">
      <h3 className="text-lg font-semibold mb-4">Performance</h3>
      <div className="flex-1 w-full min-h-0">
        <ResponsiveContainer width="100%" height="100%">
          <RadarChart cx="50%" cy="50%" outerRadius="80%" data={data}>
            <PolarGrid stroke={gridColor} />
            <PolarAngleAxis dataKey="subject" tick={{ fill: textColor, fontSize: 12 }} />
            <PolarRadiusAxis angle={30} domain={[0, 150]} tick={false} axisLine={false} />
            <Radar name="Student A" dataKey="A" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6} />
            <Radar name="Student B" dataKey="B" stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.6} />
            <Tooltip 
               contentStyle={{ 
                backgroundColor: theme === 'dark' ? '#2d2d3d' : '#fff',
                borderColor: 'transparent',
                borderRadius: '8px',
                color: theme === 'dark' ? '#fff' : '#000'
              }}
            />
          </RadarChart>
        </ResponsiveContainer>
      </div>
    </Card>
  );
}

import { BarChartBlock } from './BarChartBlock';
import { LineChartBlock } from './LineChartBlock';
import { PieChartBlock } from './PieChartBlock';
import { RadarChartBlock } from './RadarChartBlock';
import { clsx } from 'clsx';
import { Link } from 'react-router-dom';
import { Moon, Sun } from 'lucide-react';

interface DashboardLayoutProps {
  theme: 'dark' | 'light';
}

export function DashboardLayout({ theme }: DashboardLayoutProps) {
  return (
    <div className={clsx(
      "min-h-screen p-8 transition-colors duration-300",
      theme === 'dark' ? "bg-[var(--color-bg-dark)] text-white" : "bg-[var(--color-bg-light)] text-slate-900"
    )}>
      <div className="max-w-7xl mx-auto space-y-8">
        <header className="flex justify-between items-center">
          <div>
            <h1 className="text-3xl font-bold">Analytics Dashboard</h1>
            <p className={theme === 'dark' ? "text-gray-400" : "text-gray-500"}>
              Overview of current performance metrics
            </p>
          </div>
          <div className="flex gap-4">
             <Link 
              to={theme === 'dark' ? '/light' : '/'}
              className={clsx(
                "p-2 rounded-full transition-colors",
                theme === 'dark' ? "bg-white/10 hover:bg-white/20" : "bg-black/5 hover:bg-black/10"
              )}
            >
              {theme === 'dark' ? <Sun className="w-6 h-6" /> : <Moon className="w-6 h-6" />}
            </Link>
          </div>
        </header>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          <div className="lg:col-span-2">
            <LineChartBlock theme={theme} />
          </div>
          <div className="lg:col-span-1">
             <PieChartBlock theme={theme} />
          </div>

          <div className="lg:col-span-1">
            <RadarChartBlock theme={theme} />
          </div>
          <div className="lg:col-span-2">
             <BarChartBlock theme={theme} />
          </div>

           {/* Duplicate some to fill the grid as per design density */}
           <div className="lg:col-span-1">
            <PieChartBlock theme={theme} />
          </div>
          <div className="lg:col-span-1">
            <BarChartBlock theme={theme} />
          </div>
           <div className="lg:col-span-1">
            <RadarChartBlock theme={theme} />
          </div>
        </div>
      </div>
    </div>
  );
}

import { DashboardLayout } from '../components/blocks/DashboardLayout';

export default function DashboardDark() {
  return <DashboardLayout theme="dark" />;
}

import { DashboardLayout } from '../components/blocks/DashboardLayout';

export default function DashboardLight() {
  return <DashboardLayout theme="light" />;
}

import React, { Suspense } from 'react';
import { Routes, Route } from 'react-router-dom';

const DashboardDark = React.lazy(() => import('./pages/DashboardDark'));
const DashboardLight = React.lazy(() => import('./pages/DashboardLight'));

function App() {
  return (
    <Suspense fallback={<div className="min-h-screen bg-[#191C27] text-white flex items-center justify-center">Loading...</div>}>
      <Routes>
        <Route path="/" element={<DashboardDark />} />
        <Route path="/light" element={<DashboardLight />} />
      </Routes>
    </Suspense>
  );
}

export default App;
